import './Middle.css';
import React, { Component } from 'react';
import axios from 'axios';

class Middle extends Component {
    constructor(props) {
      super(props);
      this.state = {
        fetchUser: {
          count: ''
        }
      }
      this.fetchUser = this.fetchUser.bind(this);
    }
  

    fetchUser() {
        axios.get('http://localhost:8080/hcl/add/2/5')
            // method: 'GET',
            // mode: 'no-cors',
            // credentials: 'include',
            // headers: {
            //   'content-type': 'application/json',
            //   dataType: 'json'
            
          .then( response => {
            console.log("response", response);
            this.setState({
              fetchUser: response.data
            });
            console.log("fetchUser", this.state.fetchUser)
          })
          .catch( error => {
            console.log(error)
          });
        
    }
 

render() {
    

    return (
      <div>
        <p>You clicked {fetchUser.count} times</p>
        <button onClick={() => {this.fetchUser}}
          Click me>
        </button>
      </div>
    );
  }
}
  export default Middle;
